var code = ['',
'',
'',
'',
''];
/*
var code = [
'ULL',
'RRDDD',
'LURDL',
'UUUUD'
];
*/

var matrix = [
  ['' , '' , '1', '' , ''],
  ['' , '2', '3', '4', ''],
  ['5', '6', '7', '8', '9'],
  ['' , 'A', 'B', 'C', ''],
  ['' , '' , 'D', '' , '']
];

// Start position
var position = [2, 0];

var getCode = function () {
  var result = '';
  for (var i = 0; i < window.code.length; i++) {
    var moves = window.code[i];
    for (var j = 0; j < moves.length; j++) {
      var direction = moves[j];
      move(direction);
    }
    result = result.concat(matrix[position[0]][position[1]]);
  }
  return result;
};

var move = function (direction) {
  if (direction === 'U') {
    if (position[0] !== 0) {
      if (matrix[position[0] - 1][position[1]] !== '') {
        position[0]--;
      }
    }
  } else if (direction === 'D') {
    if (position[0] !== 4) {
      if (matrix[position[0] + 1][position[1]] !== '') {
        position[0]++;
      }
    }
  } else if (direction === 'L') {
    if (position[1] !== 0) {
      if (matrix[position[0]][position[1] - 1] !== '') {
        position[1]--;
      }
    }
  } else if (direction === 'R') {
    if (position[1] !== 4) {
      if (matrix[position[0]][position[1] + 1] !== '') {
        position[1]++;
      }
    }
  }
};

console.log(getCode());